import React,{useState,useEffect} from 'react'
import MurPiece from "./MurPiece"

const CasePiece = ({
   
}) => {
    
    const renderMurs=()=>{

        return (<MurPiece num={0}></MurPiece>)
    }
  
   
    return ( 
        <div 
            className='case-piece'  
        >
           { renderMurs()}

        </div>

    );
}
 
export default CasePiece;
